import React from 'react';
import { Link, useLocation } from 'react-router-dom';

const Header = ({ systemHealth }) => {
  const location = useLocation();

  const getSystemStatus = () => {
    if (!systemHealth || Object.keys(systemHealth).length === 0) {
      return { status: 'unknown', count: 0, total: 0 };
    }

    const services = Object.values(systemHealth).filter(service => 
      service && typeof service === 'object' && service.status
    );

    const healthyCount = services.filter(service => 
      service.status === 'healthy'
    ).length;

    const total = services.length;

    if (healthyCount === total && total > 0) {
      return { status: 'healthy', count: healthyCount, total };
    } else if (healthyCount > 0) {
      return { status: 'degraded', count: healthyCount, total };
    } else {
      return { status: 'unhealthy', count: healthyCount, total };
    }
  };

  const systemStatus = getSystemStatus();

  const navItems = [
    { path: '/', label: 'üé• Video Processing', icon: 'üé•' },
    { path: '/dashboard', label: 'üìä Detection Dashboard', icon: 'üìä' },
    { path: '/history', label: 'üìã Violation History', icon: 'üìã' },
    { path: '/health', label: 'üîß System Health', icon: 'üîß' }
  ];

  return (
    <header className="header">
      <div className="header-content">
        <div className="header-title">
          <span style={{ fontSize: '28px' }}>üçï</span>
          <h1>Pizza Store Detection</h1>
        </div>

        <nav className="header-nav">
          {navItems.map(item => (
            <Link
              key={item.path}
              to={item.path}
              className={`nav-link ${location.pathname === item.path ? 'active' : ''}`}
            >
              <span>{item.icon}</span>
              {item.label}
            </Link>
          ))}
        </nav>

        <div className="system-status">
          <div className={`status-indicator status-${systemStatus.status}`}></div>
          <span>
            {systemStatus.status === 'healthy' && '‚úÖ All Systems Operational'}
            {systemStatus.status === 'degraded' && `‚ö†Ô∏è ${systemStatus.count}/${systemStatus.total} Services`}
            {systemStatus.status === 'unhealthy' && '‚ùå System Issues'}
            {systemStatus.status === 'unknown' && 'üîÑ Checking...'}
          </span>
        </div>
      </div>
    </header>
  );
};

export default Header;
